webpackJsonp([0xdab525d08187],{1871:function(e,o){e.exports={data:{allTalkJson:{edges:[{node:{description:"Google I/O 2009 - The Myth of the Genius Programmer\r\n\r\nBrian Fitzpatrick, Ben Collins-Sussman\r\n\r\nA pervasive elitism hovers in the background of collaborative software development:  everyone secretly wants to be seen as a genius.  In this talk, we discuss how to avoid this trap and gracefully exchange personal ego for personal growth and super-charged collaboration.  We'll also examine how software tools affect social behaviors, and how to successfully manage the growth of new ideas.\r\n\r\nFor presentation slides and all I/O sessions, please go to: code.google.com/events/io/sessions.html",meta:{duration:"PT55M17S"},presenter:{name:"Brian Fitzpatrick & Ben Collins-Sussman"},source:{id:"0SARbwvhupQ",provider:"youtube"},slug:"google-io-2009-the-myth-of-the-genius-programmer",tag:["google","Google I/O 2009"],thumbnails:{default:{url:"https://i.ytimg.com/vi/0SARbwvhupQ/default.jpg",height:90,width:120}},title:"The Myth of the Genius Programmer"}},{node:{description:"Are languages, compilers, debuggers, and algorithms all you need to be a successful software engineer? In a perfect world, those who produce the best code should be the most successful. Unfortunately, we live in a world of imperfect people, and collaborating with others is at least as important as having great technical skills.",meta:{duration:"PT55M29S"},presenter:{name:"Brian Fitzpatrick & Ben Collins-Sussman"},source:{id:"q-7l8cnpI4k",provider:"youtube"},slug:"programming-well-with-others-social-skills-for-geeks",tag:["Google I/O 2011","Career"],thumbnails:{default:{url:"https://i.ytimg.com/vi/q-7l8cnpI4k/default.jpg",height:90,width:120}},title:"Programming Well with Others: Social Skills for Geeks"}}]}},pathContext:{speaker:"Brian Fitzpatrick & Ben Collins-Sussman"}}}});
